import React from 'react';
import styles from './Login.module.css';

const Login = () => {
  return (
    <div className={`animeLeft ${styles.modal}`}>
      <div>
        <h1>LocalFilms 3000</h1>
        <div className={styles.loginLeft}>s</div>
      </div>
      <div>Login</div>
    </div>
  );
};

export default Login;
